import React, { Component } from 'react';

class Backg1Component extends Component {
  render() {
    return (
      <div className="Backg1Component">
        <div className="content">
            <img src="./src/components/backg1Component/images/logo.png" width="100" alt="Logo" />
            <div className="content-data">
                <h1 className="headlogo">NetHosting.com</h1>
                <h2>World's No. 1 Hosting Service</h2>
                <div className="server">
                    <h4>Node.js</h4>
                    <h4>Apache</h4>
                    <h4>AngularJS</h4>
                </div>
            </div>
        </div>
      </div>
    );
  }
}

export default Backg1Component;
